import React from "react";
import planty from "../../media/plant.png";

export default function ListOfPlants({ plant }) {
  const color = (time) => {
    const time_subtraction = Date.now() - time;
    if (time === 1618274087486) {
      return <button
      style={{
        backgroundColor: "aquamarine",
        borderRadius: 5,
        border: "none",
        outline: "none",
        fontWeight: "bold",
        color:"white",
        width: "100%",
        fontSize: "20px",
        height: "30px",
      }}
      onClick={() => buttonClicks(1)}
    >
      Water
    </button>;
    } else if (time_subtraction > 21600000) {
      return <button
      style={{
        backgroundColor: "red",
        borderRadius: 5,
        border: "none",
        outline: "none",
        fontWeight: "bold",
        color:"white",
        width: "100%",
        fontSize: "12px",
        height: "30px",
      }}
      onClick={() => buttonClicks(1)}
    >
      MUST WATER
    </button>;;
    } else {
      return <button
      style={{
        backgroundColor: "aquamarine",
        borderRadius: 5,
        border: "none",
        outline: "none",
        fontWeight: "bold",
        color:"white",
        width: "100%",
        fontSize: "20px",
        height: "30px",
      }}
      onClick={() => buttonClicks(1)}
    >
      Water
    </button>;;
    }
  };
  const buttonClicks = (z) => {
    if (z === 1) {
      console.log("tesdt");
      return "Watering";
    } else if (z === 2) {
      return "Must Water";
    } else {
      return "Water";
    }
  };
  return (
    <div
      style={{ display: "flex", flexDirection: "column", alignItems: "center" }}
    >
      <img
        src={planty}
        alt="a plant"
        style={{
          width: "100px",
          backgroundColor: "#faf0e6",
          borderRadius: 10,
        }}
      />
      <h3>{plant.plantName}</h3>
      {color(plant.timestamp)}
    </div>
  );
}
